description:
My Sisters Hot Friend - Priya Rai

Priya is over at her best friends house when she sees Jordan.  It seems  that Jordan had a scare with his girlfriend when she lied about a very  serious matter.  Priya gives Jordan a lecture about being confident in  himself and not letting his girlfriend take advantage of him.  Of course  that doesn't include Priya taking advantage of Jordan herself.

